import { configureStore } from "@reduxjs/toolkit";
import userReducer from "../Features/UserSlice";
import savingReducer from "../Features/SavingSlice";

const store = configureStore({
  reducer: {
    users: userReducer,
    savings: savingReducer,
  },
});

export default store;
